declare namespace javax {
    namespace swing {
        namespace event {
            namespace HyperlinkEvent {
                /**
                 * Defines the ENTERED, EXITED, and ACTIVATED event types, along
                 * with their string representations, returned by toString().
                 */
                // @ts-ignore
                class EventType extends java.lang.Object {
                    /**
                     * Entered type.
                     */
                    // @ts-ignore
                    public static readonly ENTERED: javax.swing.event.HyperlinkEvent.EventType
                    /**
                     * Exited type.
                     */
                    // @ts-ignore
                    public static readonly EXITED: javax.swing.event.HyperlinkEvent.EventType
                    /**
                     * Activated type.
                     */
                    // @ts-ignore
                    public static readonly ACTIVATED: javax.swing.event.HyperlinkEvent.EventType
                    /**
                     * Converts the type to a string.
                     * @return the string
                     */
                    // @ts-ignore
                    public toString(): string
                }
            }
        }
    }
}
